import { jsPDF } from "jspdf";
var font =
    "";
var callAddFont = function () {
    this.addFileToVFS("EduSABeginner-normal.ttf", font);
    this.addFont("EduSABeginner-normal.ttf", "EduSABeginner", "normal");
    this.addFont("EduSABeginner-normal.ttf", "EduSABeginner", "italic");
    this.addFont("EduSABeginner-normal.ttf", "EduSABeginner", "bolditalic");
    this.addFont("EduSABeginner-normal.ttf", "EduSABeginner", "bold");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
